import React, { Component } from 'react';
import s from './css/Payment.module.css'


class Payment extends Component {

  render() {


    return (
      <div className={s.block}>
        <p className={s.left_title}>Введіть спосіб оплати</p>



      </div>
    )
  }


}

export default Payment;
